import React from 'react';
import Card from '../../../../components/common/layout/Card';

const CapTableContent = () => {
  return (
    <Card>
      <div className="p-4">
        <h2 className="text-xl font-bold mb-4">Capitalization Table</h2>
        <p>Interactive cap table coming soon...</p>
      </div>
    </Card>
  );
};

export default CapTableContent;
